import { types } from "./type";

let initialState = {
    users: [],
};
export const authReducer = (state = initialState, action) => {
    switch (action.type) {
        case types.REGISTER:
            alert("here")
            return {
                ...state,
                users: action.payload.user
            };
        default: {
            return state;
        }
    }
};
